function DESALTING_UTBS_Complete_Optim_4_Grok()
% DESALTING_UTBS_Complete_Optim_4_Grok.m
% Script complet pour la simulation du dessalage du pÃ©trole brut en deux Ã©tapes
% Converti en fonction principale pour compatibilitÃ© MATLAB R2014a
%
% Toutes les fonctions locales sont dÃ©finies en fin de fichier.

    %% Section 1 : DÃ©finitions des paramÃ¨tres physiques et discrÃ©tisation des classes de taille
    rho     = 1000;     % DensitÃ© (kg/mÂ³)
    mu      = 0.001;    % ViscositÃ© (Pa.s)
    sigma   = 0.03;     % Tension interfaciale (N/m)
    u       = 1;        % Vitesse du fluide (m/s)
    g       = 9.81;     % AccÃ©lÃ©ration due Ã  la gravitÃ© (m/sÂ²)
    t_res   = 1;        % Temps de rÃ©sidence (s)
    DeltaP  = 20;       % Chute de pression initiale (psi)
    E0      = 1.5;      % IntensitÃ© du champ Ã©lectrique initiale (kV/cm)
    rho_d   = 800;      % DensitÃ© de la phase dispersÃ©e (kg/mÂ³)
    rho_c   = 1000;     % DensitÃ© de la phase continue (kg/mÂ³)
    mu_c    = 0.001;    % ViscositÃ© de la phase continue (Pa.s)
    epsilon = 1e-3;     % Taux de dissipation d'Ã©nergie (mÂ²/sÂ³)

    % DiscrÃ©tisation des classes de taille
    d_min = 1;        % Taille minimale des gouttelettes (Âµm)
    d_max = 5000;     % Taille maximale des gouttelettes (Âµm)
    n_classes = 100;  % Nombre de classes
    d = logspace(log10(d_min), log10(d_max), n_classes);  % Distribution logarithmique
    
    % Volume des gouttelettes (mÂ³) pour chaque classe
    v = (pi/6) * (d * 1e-6).^3;
    
    % Distribution initiale
    N0 = zeros(n_classes, 1);
    N0(1:10) = 1e6;   % Exemple : concentration initiale dans les petites tailles

    %% Section 2 : Simulation des deux Ã©tapes avec recyclage de l'eau

    % 1) PremiÃ¨re Ã©tape : Vanne de mÃ©lange
    L_mix = 1; % Longueur de la vanne (m)
    z_mix = linspace(0, L_mix, 100);

    [~, N_mix] = ode45(@(z, N) pbe_mixing_valve(z, N, d, v, DeltaP, ...
                                                    rho, mu, sigma, u, t_res), ...
                           z_mix, N0);

    % 2) PremiÃ¨re Ã©tape : Tambour de dessalage
    L_des = 10; % Longueur du tambour (m)
    z_des = linspace(0, L_des, 100);

    N_in_des = N_mix(end, :);  % Sortie de la vanne = entrÃ©e du tambour
    [~, N_des] = ode45(@(z, N) pbe_desalter(z, N, d, v, E0, ...
                                                rho_d, rho_c, mu_c, epsilon), ...
                           z_des, N_in_des);

    % Recyclage de l'eau (exemple simplifiÃ© Ã  10%)
    N_recycle = 0.1 * N_des(end, :);
    N_in_mix2 = N_des(end, :) + N_recycle;

    % 3) DeuxiÃ¨me Ã©tape : Vanne de mÃ©lange
    [~, N_mix2] = ode45(@(z, N) pbe_mixing_valve(z, N, d, v, DeltaP, ...
                                                      rho, mu, sigma, u, t_res), ...
                             z_mix, N_in_mix2);

    % 4) DeuxiÃ¨me Ã©tape : Tambour de dessalage
    N_in_des2 = N_mix2(end, :);
    [~, N_des2] = ode45(@(z, N) pbe_desalter(z, N, d, v, E0, ...
                                                  rho_d, rho_c, mu_c, epsilon), ...
                             z_des, N_in_des2);

    %% Section 3 : TracÃ© des rÃ©sultats pour les figures demandÃ©es

    % Figure 8(a) : Distribution de taille le long de la vanne de mÃ©lange
    figure;
    plot(d, N_mix(1, :), 'r', 'LineWidth', 2); hold on;
    plot(d, N_mix(end, :), 'b', 'LineWidth', 2);
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Distribution de taille le long de la vanne de mÃ©lange (Fig. 8a)');
    legend('EntrÃ©e', 'Sortie');

    % Figure 8(b) : Fraction volumique Ã  la sortie de la vanne de mÃ©lange
    V_out_mix = (N_mix(end, :) .* v) / sum(N_mix(end, :) .* v);
    figure;
    plot(d, V_out_mix, 'LineWidth', 2);
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Fraction volumique');
    title('Fraction volumique Ã  la sortie de la vanne de mÃ©lange (Fig. 8b)');

    % Figure 9 : Distribution de taille Ã  la sortie de la vanne pour diffÃ©rentes Î”P
    DeltaP_values = [20, 25, 30];  % psi
    figure; hold on;
    for iDP = 1:length(DeltaP_values)
        [~, N_mixTest] = ode45(@(z, N) pbe_mixing_valve(z, N, d, v, ...
                                                DeltaP_values(iDP), rho, mu, sigma, u, t_res), ...
                                       z_mix, N0);
        plot(d, N_mixTest(end, :), 'LineWidth', 2, ...
             'DisplayName', sprintf('\\DeltaP = %d psi', DeltaP_values(iDP)));
    end
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Distribution de taille Ã  la sortie de la vanne (Fig. 9)');
    legend show;

    % Figure 10 : Distribution de taille le long du tambour de dessalage
    figure;
    plot(d, N_des(1, :), 'r', 'LineWidth', 2); hold on;
    plot(d, N_des(end, :), 'b', 'LineWidth', 2);
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Distribution de taille le long du tambour de dessalage (Fig. 10)');
    legend('EntrÃ©e', 'Sortie');

    % Figure 11(a) : Distribution de taille dans le premier tambour de dessalage
    figure;
    plot(d, N_des(end, :), 'LineWidth', 2);
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Distribution de taille dans le premier tambour (Fig. 11a)');

    % Figure 11(b) : Distribution de taille dans le second tambour de dessalage
    figure;
    plot(d, N_des2(end, :), 'LineWidth', 2);
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Distribution de taille dans le second tambour (Fig. 11b)');

    % Figure 12 : Effet de l'intensitÃ© du champ E0 sur la distribution de taille
    E0_values = [1.5, 2.0];  % kV/cm
    figure; hold on;
    for iE = 1:length(E0_values)
        [~, N_des2Test] = ode45(@(z, N) pbe_desalter(z, N, d, v, E0_values(iE), ...
                                    rho_d, rho_c, mu_c, epsilon), ...
                                z_des, N_in_des2);
        plot(d, N_des2Test(end, :), 'LineWidth', 2, ...
             'DisplayName', sprintf('E0 = %.1f kV/cm', E0_values(iE)));
    end
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Effet de E0 sur la distribution de taille (second tambour) (Fig. 12)');
    legend show;

    % Figure 13 : Effet de la chute de pression dans la vanne de la seconde Ã©tape
    DeltaP_values_mix2 = [20, 25, 30]; % psi
    figure; hold on;
    for iDP = 1:length(DeltaP_values_mix2)
        [~, N_mix2Test] = ode45(@(z, N) pbe_mixing_valve(z, N, d, v, DeltaP_values_mix2(iDP), ...
                                                         rho, mu, sigma, u, t_res), ...
                                z_mix, N_in_mix2);
        N_in_des2Test = N_mix2Test(end, :);
        [~, N_des2Test] = ode45(@(z, N) pbe_desalter(z, N, d, v, E0, ...
                                                     rho_d, rho_c, mu_c, epsilon), ...
                                z_des, N_in_des2Test);
        plot(d, N_des2Test(end, :), 'LineWidth', 2, ...
             'DisplayName', sprintf('\\DeltaP = %d psi', DeltaP_values_mix2(iDP)));
    end
    xlabel('DiamÃ¨tre (Âµm)');
    ylabel('Nombre de gouttelettes');
    title('Effet de \\DeltaP dans la vanne (seconde Ã©tape) (Fig. 13)');
    legend show;

end  % Fin de la fonction principale


