function g_break = breakage_frequency(d, DeltaP, rho, mu, sigma, u, t_res)
    % FrÃ©quence de rupture (simplifiÃ©e) en fonction du DeltaP, etc.
    % xi : paramÃ¨tre liÃ© Ã  la chute de pression
    xi = DeltaP / (t_res * rho);

    % Nombre de Capillary
    Ca = (mu * u) / sigma;
    Ca_crit = 0.1; % Valeur critique Ã  ajuster

    K = 1;         % Constante Ã  ajuster
    lambda = 1e-3; % Ã‰chelle de turbulence (m)

    % Volume de chaque classe de gouttelettes
    volDroplet = (pi/6) * (d * 1e-6).^3; 

    g_break = zeros(size(d));
    if Ca > Ca_crit
        g_break = K * xi * sqrt(sigma ./ (rho * volDroplet)) .* ...
                  ((d * 1e-6) / lambda).^(4/5);
    end
end

function f = daughter_distribution(d_i, d_j)
    % Exemple de distribution de tailles filles
    % Vous pouvez personnaliser ce noyau en fonction de vos hypothÃ¨ses
    f = (2.4 / (d_j * 1e-6)^3) * ...
        exp(-4.5 * ( (2*(d_i*1e-6).^3 - (d_j*1e-6).^3).^2 ) / ( (d_j*1e-6).^6 ));
end

function beta = collision_frequency(di, dj, E0, rho_d, rho_c, mu_c, epsilon)
    % FrÃ©quence de collision (coalescence) simplifiÃ©e
    g_local = 9.81;    % gravitÃ©

    K = 1;  % Constante Ã  ajuster

    delta = di / dj;
    % V_ij : vitesse d'approche (exemple)
    V_ij = (abs(rho_d - rho_c) * (dj * 1e-6)^2 * (1 - delta^2) * g_local) / ...
           (18 * mu_c);

    % Facteur empirique liÃ© au champ Ã©lectrique E0
    e_ij = exp(-0.45 * ((rho_d - rho_c) * g_local * (di * 1e-6) / ...
                        (epsilon * E0^2))^0.55);

    beta = K * pi * ((di + dj) * 1e-6)^2 * V_ij * e_ij;
end

function dNdz = pbe_mixing_valve(~, N, d, v, DeltaP, rho, mu, sigma, u, t_res)
    % Ã‰quation de bilan de population (PBE) pour la vanne de mÃ©lange
    n_classes = length(d);
    dNdz = zeros(n_classes, 1);

    % Calcul de la frÃ©quence de rupture
    g_val = breakage_frequency(d, DeltaP, rho, mu, sigma, u, t_res);

    % Terme de rupture (perte)
    for i = 1:n_classes
        dNdz(i) = dNdz(i) - g_val(i) * N(i);
    end

    % Terme de rupture (gain) via distribution des gouttelettes filles
    for i = 1:n_classes
        for j = i+1:n_classes
            f_ij = daughter_distribution(d(i), d(j));
            % Gain dans la classe i dÃ» Ã  la rupture des gouttes de classe j
            % On suppose une rÃ©partition volumique => ratio v(j)/v(i) 
            dNdz(i) = dNdz(i) + g_val(j) * N(j) * f_ij * (v(j) / v(i));
        end
    end
end

function dNdz = pbe_desalter(~, N, d, v, E0, rho_d, rho_c, mu_c, epsilon)
    % Ã‰quation de bilan de population (PBE) pour le tambour de dessalage
    % On y gÃ¨re la coalescence (simplifiÃ©e)

    n_classes = length(d);
    dNdz = zeros(n_classes, 1);

    % Terme de coalescence
    for i = 1:n_classes
        
        % Perte par coalescence de la classe i avec toutes les autres classes j
        for j = 1:n_classes
            beta_ij = collision_frequency(d(i), d(j), E0, rho_d, rho_c, mu_c, epsilon);
            dNdz(i) = dNdz(i) - beta_ij * N(i) * N(j);
        end
        
        % Gain par coalescence de gouttelettes plus petites (j, k) dont le volume
        % s'additionne pour donner la classe i
        for j = 1:(i-1)
            for k = 1:(i-1)
                % Conservation du volume
                if abs(v(i) - (v(j) + v(k))) < 1e-10
                    beta_jk = collision_frequency(d(j), d(k), E0, rho_d, rho_c, mu_c, epsilon);
                    dNdz(i) = dNdz(i) + 0.5 * beta_jk * N(j) * N(k);
                end
            end
        end
    end

end
